"""
Image handling module for CTF challenge.
Contains base64 encoded image data and utilities for decoding/validation.
"""

import base64
from typing import Final

def get_image_data() -> bytes:
    """Returns the embedded image data."""

    try:
        return base64.b64decode(EMBEDDED_IMAGE_DATA)
    except Exception as e:
        raise ValueError(f"Failed to decode embedded image data: {e}")

# The base64 encoded image data
EMBEDDED_IMAGE_DATA: Final[str] = """

"""